import { Link } from "react-router-dom";

const Header = () => {
  return (

    <header className="mw hd">
      <h1 > 
        <Link to="/">로고</Link>
      </h1>
      <nav>
        <Link to="/login">로그인</Link>
        <Link to="/register">회원가입</Link>
      </nav>


    </header>
  );
};

export default Header;
